function b64ToBytes(b){const s=atob(b);const u=new Uint8Array(s.length);for(let i=0;i<s.length;i++)u[i]=s.charCodeAt(i);return u;}
function boot(){document.getElementById('splash').style.display='none';document.getElementById('app').style.display='flex';loadEmulator();}
function setProgress(p,m){document.getElementById('lbar').style.width=p+'%';document.getElementById('lmsg').textContent=m;}
function showError(m){const e=document.getElementById('lerr');e.textContent=m;e.style.display='block';setProgress(100,'ERROR');}
function loadEmulator(){
  setProgress(10,'DECODIFICANDO ROM...');
  let rb;try{rb=b64ToBytes(ROM_B64);setProgress(30,'ROM OK â€” '+(rb.length/1024).toFixed(0)+'KB');}catch(e){showError('Error: '+e.message);return;}
  const url=URL.createObjectURL(new Blob([rb],{type:'application/octet-stream'}));
  setProgress(40,'CARGANDO EMULADOR...');
  window.EJS_player='#game';window.EJS_core='snes9x';window.EJS_gameUrl=url;
  window.EJS_gameName='Tetris 2';window.EJS_color='#ffaa00';
  window.EJS_backgroundColor='#000000';window.EJS_startOnLoaded=true;
  window.EJS_pathtodata='https://cdn.emulatorjs.org/stable/data/';
  window.EJS_VirtualGamepad=true;
  window.EJS_Buttons={gamepad:true,mute:true,settings:true,fullscreen:false,save:true,load:true,volume:true,quickSave:true,quickLoad:true,reset:true};
  window.EJS_defaultOptions={'save-state-slot':1,'video-smooth':false};
  window.EJS_onLoadProgress=p=>setProgress(40+p*55,'CARGANDO... '+Math.round(p*100)+'%');
  window.EJS_onGameStart=()=>{setProgress(100,'TETRIS!');setTimeout(()=>document.getElementById('loader').style.display='none',600);};
  const s=document.createElement('script');s.src='https://cdn.emulatorjs.org/stable/data/loader.js';
  s.onerror=()=>{const s2=document.createElement('script');s2.src='https://cdn.jsdelivr.net/npm/emulatorjs@latest/data/loader.js';document.head.appendChild(s2);};
  document.head.appendChild(s);
  let f=40;const iv=setInterval(()=>{if(document.getElementById('loader').style.display==='none'){clearInterval(iv);return;}f=Math.min(f+1,94);if(f<94)setProgress(f,'CARGANDO...');},300);
}
function toggleFS(){if(!document.fullscreenElement){document.documentElement.requestFullscreen({navigationUI:'hide'}).catch(()=>{});if(screen.orientation?.lock)screen.orientation.lock('landscape').catch(()=>{});}else document.exitFullscreen?.();}
let muted=false;
function toggleMute(){muted=!muted;document.getElementById('muteBtn').textContent=muted?'ðŸ”‡':'ðŸ”Š';if(window.EJS_emulator?.setVolume)EJS_emulator.setVolume(muted?0:1);document.querySelectorAll('audio,video').forEach(a=>a.muted=muted);}
document.addEventListener('touchmove',e=>{if(e.touches.length>1)e.preventDefault();},{passive:false});
document.addEventListener('gesturestart',e=>e.preventDefault(),{passive:false});
</script>
